import React from 'react';
import Blog_main from './Blog_main';

const MyBlogPage = ({ blogs }) => {
  return (
    <div>
      {blogs.map((blog) => (
        <Blog_main key={blog.id} blog={blog} />
      ))}
    </div>
  );
};

export default MyBlogPage;
